import React from "react";
import { GoogleMap, useJsApiLoader, Marker } from "@react-google-maps/api";

const containerStyle = {
  width: "100%",
  height: "100%"
};

const center = {
  lat: 9.5916,
  lng: 76.5222
};

const hospitalLocations = [
  { lat: 9.5945, lng: 76.5310 },
  { lat: 9.5900, lng: 76.5220 },
  { lat: 9.5872, lng: 76.5233 }
];

function EmergencyMap() {
  const { isLoaded } = useJsApiLoader({
    googleMapsApiKey: "YOUR_API_KEY", // Replace with your API key
  });

  return isLoaded ? (
    <GoogleMap mapContainerStyle={containerStyle} center={center} zoom={13}>
      {hospitalLocations.map((loc, i) => (
        <Marker key={i} position={loc} icon="https://maps.google.com/mapfiles/ms/icons/hospitals.png" />
      ))}
    </GoogleMap>
  ) : (
    <div>Loading...</div>
  );
}

export default EmergencyMap;
